import { Outlet } from 'react-router-dom';

export default function Layout() {
  const role = localStorage.getItem("role");
  const userDisplay = role ? `${role.charAt(0).toUpperCase() + role.slice(1)}` : "User";

  return (
    <div className="layout">
      {/* Sidebar */}
      <div className="sidebar">
        <div className="sidebar-header">
          <div className="sidebar-brand">
            <div className="sidebar-logo">
              üè•
            </div>
            <div>
              <h2 className="sidebar-title">MediCare Portal</h2>
              <p className="sidebar-subtitle">Healthcare Management</p>
            </div>
          </div>
        </div>

        <div className="sidebar-nav">
          <div className="nav-section">
            <a href={role === 'doctor' ? '/doctor' : '/receptionist'} className="nav-link active">
              <span className="nav-icon">üè†</span>
              <span>Dashboard</span>
            </a>
            {role === 'receptionist' && (
              <a href="/receptionist" className="nav-link">
                <span className="nav-icon">üë•</span>
                <span>Receptionist</span>
              </a>
            )}
            {role === 'doctor' && (
              <a href="/doctor" className="nav-link">
                <span className="nav-icon">ü©∫</span>
                <span>Doctor</span>
              </a>
            )}
          </div>

          <div className="logout-section">
            <button 
              onClick={() => {
                localStorage.removeItem('token');
                localStorage.removeItem('role');
                window.location.href = '/login';
              }}
              className="logout-btn"
            >
              <span className="nav-icon">üö™</span>
              <span>Logout</span>
            </button>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {/* Navbar */}
        <div className="navbar">
          <div className="navbar-brand">
            <div className="navbar-logo">
              <span style={{ fontSize: '20px', fontWeight: 'bold' }}>H</span>
            </div>
            <div className="navbar-info">
              <h1>Hospital Portal</h1>
              <p>Advanced Healthcare Management</p>
            </div>
          </div>

          <div className="navbar-actions">
            <button className="navbar-btn">
              üîî
            </button>

            <div className="user-info">
              <div className="user-avatar">
                üë§
              </div>
              <span>{userDisplay}</span>
            </div>

            <button 
              onClick={() => {
                localStorage.removeItem('token');
                localStorage.removeItem('role');
                window.location.href = '/login';
              }}
              className="logout-button"
            >
              üö™ Logout
            </button>
          </div>
        </div>

        {/* Content */}
        <div className="content">
          <div className="content-card">
            <Outlet />
          </div>
        </div>
      </div>
    </div>
  );
}
